        class=\\\"text-pre font-weight-bold\\\"><span>Three Legendary Guitarists,
        One Legendary Guitar</span></h2><span></span><div class=\\\"cmp cmp-read-more-less\\\"><div
        class=\\\"more text-pre\\\" style=\\\"display: none;\\\"><p><strong><em>Gibson
        Custom Shop is the pinnacle of craftsmanship, quality, and sound excellence.
        Each instrument celebrates Gibson's legacy through accuracy, authenticity,
        and attention to detail.</em></strong></p><p></p><p>The story of \u201CGreeny\u201D
        is shrouded in mystery, but few guitars are as illustrious. Greeny is one
        of the most iconic original Les Paul Standards ever made, with a unique sound
        as recognizable as the guitar itself. Previously owned by Peter Green, it
        was used throughout his time with Fleetwood Mac and later sold to Gary Moore,
        who used it for three decades with Thin Lizzy and as a solo artist. Now owned
        by Kirk Hammett, Greeny has passed through the hands of three legendary guitarists.
        Its distinctive sound is partly from the out-of-phase middle switch position
        due to the neck pickup\u2019s reversed magnetic polarity. The Kirk Hammett
        \\\"Greeny\\\" 1959 Les Paul Standard from the Gibson Custom Shop is artfully
        aged to match the original by the Murphy Lab and was inspired by this legendary
        guitar. With its Indian rosewood fretboard, it gives players around the world
        the opportunity to experience some of the magic of \\\"Greeny\\\" for themselves.
        A brown/pink Lifton\u2122 reissue 5-latch case is also included. </p></div><div
